namespace Shine
{
	/** 玩家群数据变更类型(generated by shine) */
	export class RoleGroupChangeType
	{
		/** 名字 */
		public static Name:number=1;
		
		/** 公告 */
		public static Notice:number=2;
		
		/** 等级 */
		public static Level:number=7;
		
		/** 申请方式 */
		public static ApplyType:number=4;
		
		/** 申请时是否可直接入群(无需同意) */
		public static CanApplyInAbs:number=4;
		
		/** 成员数目 */
		public static MemberNum:number=5;
		
		/** 经验 */
		public static Exp:number=6;
		
		/** 长度 */
		public static size:number=8;
		
	}
}
